armadillo.App.prototype.stripLastPathComponent=function(r){for(var p=r.length-1;p>=0;--p)if(r[p]=="/")if(p!=r.length-1)return r.substring(0,p+1);return"/"};armadillo.App.prototype.joinPath=function(){var r="",p=arguments.length-1;$.each(arguments,function(K,N){if(!(N=="/"&&K!=0)){r+=N;if(N[N.length-1]!="/"&&K!=p)r+="/"}});return r};armadillo.App.prototype.clearError=function(r){var p=$("#error");!p.text()||!r?p.hide():p.fadeOut(500,function(){p.text("")})};armadillo.App.prototype.showError=function(r){$("#error").text(r).fadeIn(1E3)};
armadillo.App.prototype.mkdirHandler_=function(){var r=prompt("Name the new subdirectory","");r!=null&&r!=""&&this.sendRequest("mkdir",{path:this.joinPath(this.getCurrentPath(),r)},function(p){if(p.error)app.showError(p.message);else{app.clearError();app.list(app.getCurrentPath())}})};
